import { useSelector } from "react-redux";
import '../images/background.jpg'

const Home = () => {
    const {user} = useSelector((state) => ({...state}));
    return (
      <div className="container-fluid h1 p-5 text-center">
        Home Page {JSON.stringify(user)}
        
      
    </div>
      
    );
  };
  
  export default Home;
